import React, { useState } from 'react';
import { TextField, Button, Typography, Paper } from '@material-ui/core';
import useStyles from './styles';


const Form = () => {
    const [flightData, setFlightData] = useState({
        flightNumber: Number,
        departureDate: Date,
        arrivalDate: Date,
        departureTime: Date,
        arrivalTime: Date,
        departureAirport: '',
        arrivalAirport: '',
        passengerCount: 0,
        passengerLimit: Number,
        selectedFile: ''

    })
    const classes = useStyles();

    const handleSubmit =() => {

    }

    return (
        <Paper className={classes.paper}>
            <form autoComplete="off" noValidate className={classes.form} onSubmit={handleSubmit}>
                <Typography variant="h6">Creating a Flight </Typography>
                <TextField
                    name="Flight Number" 
                    variant="outlined" 
                    label="Flight Number" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Departure Date" 
                    variant="outlined" 
                    label="Departure Date" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Flight Number" 
                    variant="outlined" 
                    label="Arrival Date" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Departure Time" 
                    variant="outlined" 
                    label="Departure Time" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Arrival Time" 
                    variant="outlined" 
                    label="Arrival Time" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Departure Airport" 
                    variant="outlined" 
                    label="Departure Airport" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Arrival Airport" 
                    variant="outlined" 
                    label="Arrival Airport" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Passenger Count" 
                    variant="outlined" 
                    label="Passenger Count" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
                <TextField
                    name="Flight Number" 
                    variant="outlined" 
                    label="Flight Number" 
                    fullWidth
                    value={flightData.creator}
                    onChange={(e) =>setFlightData({ ...flightData, creator: e.target.value }) } 
                />
            </form>

        </Paper>
    );
}

export default Form;
